import React, { useState, useEffect } from "react";
import { useForm, Controller } from "react-hook-form";
import { useTranslation } from "react-i18next";
import i18next from "i18next";
import { Route, Routes, Link } from "react-router-dom";
import Backbtn from '../images/back-btn.png';
import { useData } from "../DataContext";

const SelectCountry = () => {
    const { setValues, data } = useData();
    const [selectCountry, setSelectCountry] = useState(null);
    const [selectCity, setSelectCity] = useState(null);

    const { t } = useTranslation();
    const onChangeHandler = (e) => {
        const index = e.target.selectedIndex;
        const el = e.target.childNodes[index]
        const option =  el.getAttribute('id');  
        i18next.changeLanguage(option)
      }

      const {
        register,
        formState: { errors, isValid },
        handleSubmit,
        control,
        reset,
        watch,
        getValues,
    } = useForm({ 
        defaultValues : {
            country : data.country, city : data.city
        },
        mode: "onChange" });


    const onSubmit = (data) => {
        console.log(JSON.stringify(data));
        setValues(data);

    };
    const selectedCountry = watch('country');
    const selectedCity = watch('city');
    const selectedOption = watch('selectInput');

  return (
    <div className="reg">
        <Link to="/">
        <img className='back_btn' src={Backbtn} alt=" back btn" />
      </Link>
    <div className="reg_btns">
        <div className="reg_light"></div>
        <div className="reg_light active"></div>
    </div>

    <form className="reg_form" onSubmit={handleSubmit(onSubmit)}>
        <div className="block1">
        <select  onChange={(e) => {
    setSelectCountry(e.target.value);
    onChangeHandler(e);
  }} defaultValue={'def_country'} className="form-control" {...register("country", { required: true })}>
  <option value='def_country' disabled>{t('reg_country')}</option>
  <option value="kg">Кыргызстан</option>
</select>
        <div>
                 {errors?.country && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.country?.message || "Error"}
                        </p>
                    )}
                 </div>
        </div>


        <div className="block2">
        <select   onChange={(e) => {
    setSelectedCity(e.target.value);
  }} defaultValue={'def_city'} className="form-control"  {...register('city', {
              required: selectedCountry !== 'def_country',
            })}>
  <option value='def_city' disabled >{t('reg_city')}</option>
  {selectedCountry === 'kg' && (
              <>
                <option value="bishkek">Bishkek</option>
                <option value="osh">Osh</option>
                <option value="batken">Batken</option>
                <option value="issyk-kul">Issyk-Kul</option>
                <option value="jalal-abad">Jalal-Abad</option>
                <option value="naryn">Naryn</option>
                <option value="talas">Talas</option>
              </>
            )}
</select>
                 <div>
                 {errors?.city && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.city?.message || "Error"}
                        </p>
                    )}
                 </div>
        </div>
        <div className="block4">
            <button
                className="reg_submit btn"
                type="submit"
                disabled={!isValid}
            >
                {t("reg_submit")}
            </button>
        </div>

        <div className="block5">
            <p>
                {t("reg_checkReg")}{" "}
                <a
                    style={{
                        textDecoration: "none",
                        color: "#7F3A85",
                        cursor: "pointer",
                    }}
                    href=""
                >
                    {t("reg_login")}
                </a>{" "}
            </p>
        </div>
        <div className="block7">
            <select
                className="select-css"
                name="language"
                id="language"
                onChange={onChangeHandler}
            >
                <option
                    id="ky"
                    value="ky"
                >
                    кыргызча
                </option>

                <option
                 id="ru"
                    value="ru"
                >
                    русский
                </option>
            </select>
        </div>

    </form>
</div>
  )
}

export default SelectCountry
